import React from 'react';
import { Text,StyleSheet, View } from 'react-native';
import  Search from './Search'
import Icons from './Icons'
import { FontAwesome5 } from '@expo/vector-icons'; 
const Entete =props => {
        return (
     <View>
        <View style={styles.itemView}>
           <Text style={styles.itemText1}> Bienvenue Ahmed</Text>
           <Search/>
           <Text style={styles.itemText2}>Lundi 12 Mars 2021</Text> 
      
        <View>
          <View style={styles.itemView1}>
          <View style={styles.itemView2}>
               <TouchableOpacity>
                 <FontAwesome5 name="temperature-high" style={styles.itemFont} />
             </TouchableOpacity>
                    <Text style={styles.itemText}>Lundi 12 Mars 2021</Text> 
          </View>
            <Icons/>
          </View>
          <View style={styles.itemView1}>
            <Icons/>
            <Icons/>
          </View>
          <View style={styles.itemView1}>
            <Icons/>
            <Icons/>
          </View>
        </View>
        </View>
        </View>
        );
      };
    
    // create style to component
    const styles = StyleSheet.create({
        itemView: {
        backgroundColor: '#008000',
        borderBottomLeftRadius: 100,
        borderBottomRightRadius: 100,
        height:300
      },
      itemText1: {
        color: '#FFFFFF',
        marginTop: 20,
        marginLeft: 40,
        fontSize:20
      },
      itemText2: {
        color: '#FFFFFF',
        marginLeft: 200,
        fontSize:10,
        borderRadius: 50,
        

      },
      itemView1: {
       
        flexDirection: 'row'
      },
      itemView2: {
        backgroundColor: 'white',
        height:150,
        width:150,
        margin:10,
        marginRight:10,
        marginLeft:20,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
      },
      itemFont: {
       color:'red',
       fontSize:24,
       marginTop:20,
       marginLeft:40,
       backgroundColor: 'white',
       borderRadius: 500,
       width:70,
       padding:20,
       shadowColor: "#000",
       shadowOffset: {
         width: 0,
         height: 16,
       },
       shadowOpacity: 0.58,
       shadowRadius: 16.00,
       
       elevation: 24,
       
      },
      itemText:{
        textAlign: 'center'
      }
      });
    //Export to component so we can use it elsewhere in our project
    export default  Entete ;
